import { useState } from "react";

const profesoriDummy = ["Zurini", "Toma", "Dorian Popa", "Miguel"];

function AlegeProfesor() {
  const [profesor, setProfesor] = useState("");

  return (
    <form onSubmit={(e) => e.preventDefault()} className="profesorContainer">
      <div className="profesorGroup">
        <label htmlFor="profesor">Alegeti profesorul coordonator dorit:</label>
        <select
          id="profesor"
          value={profesor}
          onChange={(e) => setProfesor(e.target.value)}
          required
        >
          <option value="">Selecteaza</option>
          {profesoriDummy.map((element) => (
            <option value={element}>{element}</option>
          ))}
        </select>
        <button type="submit" className="formButton">
          Trimite
        </button>
      </div>
    </form>
  );
}

export default AlegeProfesor;
